import React from 'react';


class Login extends React.Component{
    componentDidMount() {
        document.title = 'Login';
    }

    render() {
        const form =
            <>
                <div className="row justify-content-center mt-5">

                    <div className="d-block col-lg-8 col-md-8 col-sm-10 col-xl-8 border shadow">
                        <div className="col-12">
                            <div className="row justify-content-center">
                                 <h1>
                                    this is the login page
                                </h1>
                            </div>
                        </div>
                         <form method="POST" action="#">
                              <div className="row form-group justify-content-center d-inline">
                                 <input type="email" name="email" className="form-control mt-2 ml-5 col-10" />
                                 <input type="password" name="password" className="form-control mt-2 ml-5 col-10" />
                                 <input type="submit"  className="btn btn-primary float bg-primary mt-4 border-none col-10 ml-5" value="Log in"/>

                                      <div className="col-10 ml-4 mt-5">
                                          <p>
                                              Don't have an account ?
                                              <a href="#" className="ml-2">
                                                  Register here.
                                              </a>
                                          </p>

                                        </div>
                              </div>
                         </form>
                    </div>
                </div>

                </>;

        return (form);
    }
}

export default Login;
